@Test
public void testMortonEncoding() throws Exception {
  long hash = GeoUtils.mortonHash(180, 90);
  assertEquals(180.0, GeoUtils.mortonUnhashLon(hash), 0);
  assertEquals(90.0, GeoUtils.mortonUnhashLat(hash), 0);
}

